const allure = require('allure-commandline');

exports.config = {
    runner:'local',
    port:4723,
    host:'localhost',
    path:'/wd/hub',
    loglevel:'info',
    framework:'mocha',
    mochaOpts:{
        ui:'bdd',
        require:['@babel/register'],
        timeout:600000

    },
    waitforTimeout:10000,
    maxInstances:1,
    sync:true,
    specs:[
       // './PlayWithMocha.js'
       //'./api/click.js'
       //'./api/setValue.js'
       //'./api//addValue.js'
      // './api/getText.js'
      //'./api/switch.js'
      //'./api/waitForDisplayed.js'
     // './api/saveScreenShot.js'
